swaptrade_modal_desc_crosschain_valuedif:
In die Wertdifferenz dieser Bridge-Transaktion sind folgende Gebühren eingerechnet:
• Cross-Chain-Bridge-Gebühr: {bridgePriceAndFee}
• Netzwerkgebühr auf der Ziel-Chain: {toChainPriceAndFee}

• Wenn Sie eine bestimmte Menge an Token handeln, beeinflusst das die Tiefe des Liquiditätspools. Dadurch ändern sich wiederum die Gesamtverfügbarkeit und die Token-Preise, was zu spürbaren Preisunterschieden führt.

swaptrade_swap_dialog_desc_bridge_risk:
Der aggregierte {thirdParty} („Drittanbieter“) in OKX Wallet („OKX“) ist eine zentrale Bridge mit eigenen Servicebedingungen. OKX ist nicht mit dem Betrieb des Drittanbieters verbunden und hat keine Kontrolle über ihn. OKX gewährt keinerlei Zusicherungen in Bezug auf die Inhalte und Dienste von Drittanbietern.

Sie stimmen zu und erkennen an, dass: (a) OKX nicht für Verluste, Schäden oder andere Folgen haftet, die sich aus Ihrer Nutzung des Drittanbieters ergeben, einschließlich {freezeContent};
(b) OKX nicht auf Beschwerden oder Streitigkeiten in Bezug auf Ihre Nutzung des Drittanbieters reagiert und dass Sie sich bei solchen Beschwerden und Streitigkeiten unter {thirdPartyContact} direkt an den Drittanbieter wenden.

swaptrade_mid_dialog_desc_est_network_fe:
Bei Bridge-Transaktionen umfasst diese Gebühr die Netzwerkgebühren sowohl für das Quellnetzwerk als auch für die Cross-Chain-Bridge.

Die Gebühr für diese Transaktion setzt sich wie folgt zusammen:
· {chain} Netzwerkgebühr: {value1}
· {bridge} Bridge-Netzwerkgebühr: {value2}

Wir erheben keine Netzwerkgebühren, sondern es handelt sich um Zahlungen an die Miner.

swaptrade_intro_dialog_desc_cross_value_:
Die Wertdifferenz dieser Transaktion wird wie folgt angezeigt:
· {chain}Netzwerkgebühr: {value1}
· {bridge}Bridge-Gebühr: {value2}

Wenn die Wertdifferenz viel größer ist, während die oben aufgeführten Gebühren relativ klein sind, liegt das daran, dass der Bridge-Betrag die Tiefe des Liquiditäts-Pools dieses Token-Paares beeinflusst hat.

swaptrade_intro_tooltip_trade_including_:
Bei Bridge-Transaktionen umfassen die Kosten die Netzwerkgebühren des Zahlungsnetzwerks und einen Teil der Cross-Chain-Bridge-Gebühr. Aufschlüsselung der Gebühren für diese Transaktion:
• Netzwerkgebühr: {fromChainPriceAndFee}
• Cross-Chain-Bridge-Gebühr: {bridgePriceAndFee}
Die Netzwerkgebühr wird zur Abdeckung der Miner-Kosten verwendet und nicht von unserer Plattform erhoben.

swaptrade_dialog_subtitle_agree_acknowle:
